import React from "react";
import { Link, Router, withRouter } from "react-router-dom";

const Menu = () => (
  <div className="bg-primary">
    <nav className="navbar fixed-top navbar-light bg-light">
      {/* <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button> */}
        <Link className="nav-link active" to="/">Accueil</Link>
        <ul className="nav nav-tabs">
          <li className="nav-item">
            <Link className="navbar-link mr-3" to="/signup">Rejoindre</Link>
          </li>
          <li className="nav-item">
          <Link className="navbar-link mr-3" to="/signin">Connexion</Link>
          </li>
          {/* {JSON.stringify(Router.history)}; */}
        </ul>
        <form className="form-inline my-2 my-lg-0">
          <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
          <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Chercher un pirate</button>
        </form>
    </nav>
  </div>
);

export default withRouter(Menu);
